import { useState } from "react";

function ClassEdit() {
  const [formData, setFormData] = useState({
    schedule_time: "",
    class_name: "",
  });

  const { schedule_time, class_name } = formData;

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };
  return (
    <div>
      <h2>Switch it up..</h2>
    </div>
  );
}

export default ClassEdit;
